import React from 'react';

const Blog = () => {
  return (
    <section id="blog" className="section">
      <h2>Blog</h2>
      <div className="blog-posts">
        <div className="blog-post">
          <h3><a href="#">Why Web Design is Crucial for Business Success</a></h3>
          <p>A deep dive into the impact of good design on a company's growth...</p>
          <a href="#" className="cta-button">Read More</a>
        </div>
        <div className="blog-post">
          <h3><a href="#">Top Web Development Frameworks in 2025</a></h3>
          <p>Explore the most popular frameworks that are shaping the future of web development...</p>
          <a href="#" className="cta-button">Read More</a>
        </div>
      </div>
    </section>
  );
};

export default Blog;
